import { useState } from "react";

const Dashboard = () => {
  const [activeTab, setActiveTab] = useState("create");

  const renderForm = () => {
    switch (activeTab) {
      case "create":
        return (
          <form>
            {/* Form for creating a rule */}
            <div className="mb-3">
              <label htmlFor="rule" className="form-label">Enter Rule:</label>
              <textarea className="form-control" id="rules"></textarea>
            </div>
            <button type="submit" className="btn btn-primary">Create Rule</button>
          </form>
        );
      case "combine":
        return (
          <form>
            {/* Form for combining rules */}
            <div className="mb-3">
              <label htmlFor="rules" className="form-label">Enter Rules to Combine:</label>
              <textarea className="form-control" id="rules"></textarea>
            </div>
            <button type="submit" className="btn btn-primary">Combine Rules</button>
          </form>
        );
      case "evaluate":
        return (
          <form>
            {/* Form for evaluating rules */}
            <div className="mb-3">
              <label htmlFor="data" className="form-label">Enter Data to Evaluate:</label>
              <textarea className="form-control" id="data"></textarea>
            </div>
            <button type="submit" className="btn btn-primary">Evaluate Rule</button>
          </form>
        );
      default:
        return null;
    }
  };

  return (
    <section>
      <div className="container">
        <div className="row mt-5">
          <div className="col-lg-12 text-center fs-1 fw-bold menu text-dark">
            Rules & Eligibility
          </div>
        </div>
        <div className="row">
          <div className="col-lg-12 p-5 text-center">
            <div className="btn-group">
              <button
                className={`btn btn-outline-dark fw-bold ${activeTab === "create" ? "active" : ""}`}
                role="group"
                style={{ padding: "4px 15px 4px" }}
                onClick={() => setActiveTab("create")}
              >
                Create Rule
              </button>
              <button
                className={`btn btn-outline-dark fw-bold ${activeTab === "combine" ? "active" : ""}`}
                role="group"
                style={{ padding: "4px 15px 4px" }}
                onClick={() => setActiveTab("combine")}
              >
                Combine Rules
              </button>
              <button
                className={`btn btn-outline-dark fw-bold ${activeTab === "evaluate" ? "active" : ""}`}
                role="group"
                style={{ padding: "4px 15px 4px" }}
                onClick={() => setActiveTab("evaluate")}
              >
                Evaluate Rules
              </button>
            </div>
          </div>
        </div>
        <div className="row mb-5">
          <div className="container p-5 feedback-box">
            <div className="row">
              <u>
                <h3 className="text-center underlined">{activeTab === "create" ? "Create Rule" : activeTab === "combine" ? "Combine Rules" : "Evaluate Rules"}</h3>
              </u>
            </div>

            <div className="row">
              <div className="col-lg-3"></div>
              <div className="col-lg-6">
                {renderForm()}
              </div>
              <div className="col-lg-3"></div>
            </div>
          </div> {/* container end*/}
        </div> {/* row end*/}
      </div> {/* container end*/}
    </section>
  );
};

export default Dashboard;
